import myImg from '../myImg.jpg';
import './Home.css';
function Home(){
    return(
        <div className="wrapper">
            <section className="img-info">
                <img src={myImg} alt="A person"/>
                <div>
                    <h1>Marc Albert Bautista</h1>
                    <p>Your Aspiring Full-Stack Developer</p>
                </div>
            </section>
        </div>
    );
}
export default Home
